"use strict";(self.webpackChunkenterprise_docs=self.webpackChunkenterprise_docs||[]).push([[540],{4951:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"welcome","metadata":{"permalink":"/FydeOS-enterprise-docs/zh-Hans/blog/welcome","source":"@site/i18n/zh-Hans/docusaurus-plugin-content-blog/2021-08-26-welcome/index.md","title":"\u6b22\u8fce","description":"\u4f60\u597d\uff0c\u6b22\u8fce\u6765\u5230FydeOS \u4f01\u4e1a\u535a\u5ba2\uff01\u6211\u4eec\u975e\u5e38\u9ad8\u5174\u4f60\u80fd\u4e0e\u6211\u4eec\u4e00\u540c\u5f00\u59cb\u8fd9\u4e2a\u5173\u4e8e FydeOS \u7684\u63a2\u7d22\u548c\u53d1\u73b0\u7684\u65c5\u7a0b\u3002","date":"2021-08-26T00:00:00.000Z","formattedDate":"2021\u5e748\u670826\u65e5","tags":[{"label":"FydeOS","permalink":"/FydeOS-enterprise-docs/zh-Hans/blog/tags/fyde-os"},{"label":"FydeOS \u4f01\u4e1a\u670d\u52a1","permalink":"/FydeOS-enterprise-docs/zh-Hans/blog/tags/fyde-os-\u4f01\u4e1a\u670d\u52a1"},{"label":"FydeOS \u4e91\u96c6\u7ba1\u5e73\u53f0","permalink":"/FydeOS-enterprise-docs/zh-Hans/blog/tags/fyde-os-\u4e91\u96c6\u7ba1\u5e73\u53f0"}],"readingTime":2.405,"hasTruncateMarker":false,"authors":[{"name":"Archie","title":"FydeOS \u4f01\u4e1a\u767e\u79d1\u7ef4\u62a4\u8005","imageURL":"https://avatars.githubusercontent.com/u/63381047?v=4","key":"Archie"}],"frontMatter":{"slug":"welcome","title":"\u6b22\u8fce","authors":["Archie"],"tags":["FydeOS","FydeOS \u4f01\u4e1a\u670d\u52a1","FydeOS \u4e91\u96c6\u7ba1\u5e73\u53f0"]}},"content":"\u4f60\u597d\uff0c\u6b22\u8fce\u6765\u5230**FydeOS \u4f01\u4e1a\u535a\u5ba2**\uff01\u6211\u4eec\u975e\u5e38\u9ad8\u5174\u4f60\u80fd\u4e0e\u6211\u4eec\u4e00\u540c\u5f00\u59cb\u8fd9\u4e2a\u5173\u4e8e FydeOS \u7684\u63a2\u7d22\u548c\u53d1\u73b0\u7684\u65c5\u7a0b\u3002\\n\\n\u6211\u4eec\u7684\u535a\u5ba2\u65e8\u5728\u4e3a\u4f60\u63d0\u4f9b\u6709\u5173 FydeOS \u4f01\u4e1a\u670d\u52a1\u7684\u6240\u6709\u5185\u5bb9\u3002\u6211\u4eec\u5728\u8fd9\u91cc\u5206\u4eab\u6d1e\u89c1\uff0c\u63d0\u4f9b\u63d0\u793a\uff0c\u5e76\u63a2\u8ba8\u6700\u65b0\u7684\u66f4\u65b0\uff0c\u4ee5\u5e2e\u52a9\u4f01\u4e1a\u3001IT \u4e13\u4e1a\u4eba\u5458\u548c\u4e2a\u4eba\u5145\u5206\u4f7f\u7528 FydeOS\u3002\\n\\n\u8fd9\u4e0d\u4ec5\u4ec5\u662f\u4e00\u7cfb\u5217\u6587\u7ae0\u7684\u96c6\u5408\uff0c\u5b83\u4e5f\u662f\u4e00\u4e2a\u5bf9\u4e91\u7cfb\u7edf\u5145\u6ee1\u70ed\u60c5\u7684\u4eba\u7684\u7e41\u8363\u793e\u533a\u3002\\n\\n---\\n\\n## **\u671f\u5f85\u4ec0\u4e48**\\n\\n\u5728\u63a5\u4e0b\u6765\u7684\u65f6\u95f4\u4e2d\uff0c\u6211\u4eec\u5c06\u6df1\u5165\u63a2\u8ba8\u4e00\u7cfb\u5217\u4e3b\u9898\uff1a\\n\\n- \u7b80\u5316\u6211\u4eec\u5e73\u53f0\u590d\u6742\u6027\u7684\u8be6\u7ec6\u6307\u5357\u3002\\n- \u5c55\u793a FydeOS \u5728\u591a\u6837\u5316\u4e1a\u52a1\u573a\u666f\u4e2d\u7684\u53d8\u9769\u529b\u91cf\u7684\u6848\u4f8b\u7814\u7a76\u3002\\n- \u4e13\u5bb6\u8bbf\u8c08\u548c\u9886\u5bfc\u601d\u60f3\u6587\u7ae0\uff0c\u4ee5\u8ba9\u4f60\u968f\u65f6\u4e86\u89e3\u4e91\u8ba1\u7b97\u9886\u57df\u7684\u6700\u65b0\u8d8b\u52bf\u548c\u6280\u672f\u3002\\n\\n---\\n\\n## **\u52a0\u5165\u6211\u4eec\u7684\u793e\u533a**\\n\\n\u6211\u4eec\u9f13\u52b1\u4f60\u63a2\u7d22\uff0c\u63d0\u95ee\uff0c\u5e76\u5206\u4eab\u4f60\u7684\u7ecf\u9a8c\u3002\u65e0\u8bba\u4f60\u662f\u8de8\u56fd\u516c\u53f8\u7684 IT \u7ecf\u7406\uff0c\u8fd8\u662f\u521d\u521b\u516c\u53f8\u7684\u5f00\u53d1\u4eba\u5458\uff0c\u6216\u8005\u53ea\u662f\u60f3\u5b66\u4e60\u66f4\u591a\u7684\u6280\u672f\u7231\u597d\u8005\uff0c\u8fd9\u91cc\u90fd\u6709\u4f60\u9700\u8981\u7684\u3002\\n\\n---\\n\\n## **\u6211\u4eec\u7684\u627f\u8bfa**\\n\\n\u6211\u4eec\u81f4\u529b\u4e8e\u4e3a\u4f60\u521b\u9020\u4e00\u4e2a\u65e0\u7f1d\u7684\u3001\u4ea4\u4e92\u5f0f\u7684\u3001\u5bcc\u6709\u4fe1\u606f\u7684\u4f53\u9a8c\uff0c\u8fd9\u662f\u6211\u4eec\u6240\u505a\u7684\u4e00\u5207\u7684\u6838\u5fc3\u3002\u56e0\u6b64\uff0c\u6b22\u8fce\u6765\u5230 FydeOS \u7ba1\u7406\u4e91\u4f01\u4e1a Wiki \u535a\u5ba2 - \u4f60\u5145\u5206\u5229\u7528 FydeOS \u7684\u7edd\u4f73\u77e5\u8bc6\u6765\u6e90\u3002\\n\\n\u4e3a\u4e86\u786e\u4fdd\u4f60\u4e0d\u4f1a\u9519\u8fc7\u4efb\u4f55\u66f4\u65b0\uff0c\u6211\u4eec\u9080\u8bf7\u4f60\u8ba2\u9605\u6211\u4eec\u7684\u535a\u5ba2\uff0c\u5173\u6ce8\u6211\u4eec\u7684\u793e\u4ea4\u5a92\u4f53\u9891\u9053\uff0c\u52a0\u5165\u6211\u4eec\u7684\u793e\u533a\u3002\\n\\n---\\n\\n\u8ba9\u6211\u4eec\u4e00\u8d77\u8fc8\u5411 FydeOS \u7684\u672a\u6765\uff01\\n\\n\u611f\u8c22\u4f60\u52a0\u5165\u8fd9\u4e2a\u6fc0\u52a8\u4eba\u5fc3\u7684\u65c5\u7a0b\uff0c\u6211\u4eec\u671f\u5f85\u7740\u4e0e\u4f60\u4ea4\u6d41\uff0c\u5411\u4f60\u63d0\u4f9b\u4fe1\u606f\uff0c\u5e76\u7528\u9a71\u52a8\u4e91\u8ba1\u7b97\u4e16\u754c\u8fdb\u6b65\u7684\u77e5\u8bc6\u8d4b\u4e88\u4f60\u529b\u91cf\u3002\\n\\n*\u6700\u8bda\u631a\u7684\u95ee\u5019\uff0c*\\n\\n*FydeOS \u7ba1\u7406\u4e91\u4f01\u4e1a\u56e2\u961f*"}]}')}}]);